  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115020 includes chemical,
  discrete sample, physical and profile data collected from AURORA AUSTRALIS in the
  Indian Ocean and South Pacific Ocean from 1994-12-13 to 1995-02-01 and retrieved
  during cruise WOCE_SR3S4. These data include ALKALINITY, CHLOROFLUOROCARBON-11 (CFC-11),
  CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), Carbon tetrachloride
  (CCL4), DELTA HELIUM-3, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC
  PRESSURE, NEON, NITRATE, NITRITE, PHOSPHATE, Potential temperature (theta), SALINITY,
  SILICATE and WATER TEMPERATURE. The instruments used to collect these data include
  CTD and bottle. These data were collected by Bronte Tilbrook and Stephen R. Rintoul
  of Commonwealth Scientific and Industrial Research Organization as part of the WOCE_SR3S4
  data set.nnThe World Ocean Circulation Experiment (WOCE) was a major component of
  the World Climate Research Program with the overall goal of better understanding
  the ocean's role in climate and climatic changes resulting from both natural and
  anthropogenic causes. The CO2 survey took advantage of the sampling opportunities
  provided by the WOCE Hydrographic Program (WHP) cruises during this period between
  1990 and 1998. The final collection covers approximately 23,000 stations from 94
  WOCE cruises.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
